import React, { useEffect } from "react";
import Accordin from "./Accordin";

const AccordinMaker = ({ objects ,id ,name ,onDelete,onEdit,content}) => {

  return (
    <div className="mt-2">
      {objects.map((object) => (
        <Accordin key={object[id]} object={object} name={name} onDelete={onDelete} onEdit ={onEdit} id ={id} content={content.filter((obj)=>object[id]===obj[id])}/>
      ))}
    </div>
  );
};

export default AccordinMaker;
